function flipBits(nums: number[], start: number, end: number): void {
  for (let i = start; i <= end; i++) {
    nums[i] = nums[i] === 1 ? 0 : 1;
  }
}

export function minKBitFlips(nums: number[], k: number): number {
  let start = 0;
  let totalFlips = 0;
  let totalZeroes = 0;
  while (start <= nums.length - k) {
    while (nums[start] === 1) {
      start += 1;
    }
    if (start > nums.length - k) {
      break;
    }

    // current element is 0
    flipBits(nums, start, start + k - 1);
    totalFlips += 1;
  }
  nums.forEach((num) => {
    if (num === 0) {
      totalZeroes += 1;
    }
  });
  return totalZeroes === 0 ? totalFlips : -1;
}

console.log(minKBitFlips([0, 1, 0], 1)); // 2
console.log(minKBitFlips([1, 1, 0], 2)); // -1
